import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./note";
import notes from "../notes";
function App(){
    return (<div>
        <Header />
       { notes.map(note=> 
                <Note 
               key={note.id}
               title={note.title} 
               content={note.content}    
               />
            )}
        <Footer />
    </div>
    );
}
export default App;
